public String getWebScheme() {
  NamenodeMembershipRecordProtoOrBuilder proto =
          this.translator.getProtoOrBuilder();
  if (!proto.hasWebScheme()) {
    return null;
  }
  return this.translator.getProtoOrBuilder().getWebScheme();
}
